public boolean equals(Object obj) {
  if (this == obj) {
    return true;
  }
  if (obj == null) {
    return false;
  }
  if (getClass() != obj.getClass()) {
    return false;
  }
  RMNodeAttribute other = (RMNodeAttribute) obj;
  if (attribute == null) {
    if (other.attribute != null) {
      return false;
    }
  } else if (!attribute.equals(other.attribute)) {
    return false;
  }
  return true;
}
